import React from 'react';
import Overworld from '../Overworld';
import styled from 'styled-components';

function Game() {
  return <Overworld />;
}

const GameBody = styled.div`
  display: grid;
  grid-template-areas:
    'menu menu menu menu'
    'disp disp bars bars'
    'disp disp stat stat'
    'map map map map'
    'map map map map';
  grid-template-rows: 4fr 9fr 9fr 9fr 9fr;
  grid-template-columns: 1fr 1fr 1fr 1fr;
`;

export default Game;
